#define MAX(a,b) ((a) > (b) ? (a) : (b))
#define MIN(a,b)  ((a) < (b) ? (a) : (b))
#define inf 1000000000

double d[205][205];
double v[205][205],u[205][205];

int main()
{
	int i,j,k,tests,cs=0,n,m;
	while(scanf("%d%d",&n,&m)==2)
	{
		if(!n && !m) break;

		for(i=1;i<=n;i++)
				for(j=1;j<=n;j++)
					d[i][j]=d[j][i]=v[i][j]=v[j][i]=inf;


		for(i=0;i<m;i++)
		{
			int a,b;
			double vv,tt;
			scanf("%d%d%lf%lf",&a,&b,&vv,&tt);
			d[a][b]=d[b][a]=vv;
			v[a][b]=v[b][a]=vv;
			u[a][b]=u[b][a]=tt;
		}


		for(k=1;k<=n;k++)
			for(i=1;i<=n;i++)
				for(j=1;j<=n;j++)
					d[i][j]=MIN(d[i][j],d[i][k]+d[k][j]);

		for(i=1;i<=n;i++)
			d[i][i]=0.0;

		double ans=d[1][n];

		if(ans==inf)
		{
			puts("-1.000");
			continue;
		}

		for(i=1;i<=n;i++)
			for(j=1;j<=n;j++)
			{
				if(i==j || v[i][j]==inf) continue;

				double lo=0.0,hi=10.0;
				double t1=d[1][i];

				while(hi-lo>1e-6)
				{
					double left  = (2.0*lo+hi)/3.0;
					double right = (lo+2.0*hi)/3.0;

					double l1= t1+left  + v[i][j]*pow(u[i][j],-t1-left)  + d[j][n];
					double l2= t1+right + v[i][j]*pow(u[i][j],-t1-right) + d[j][n];

					if(l1<l2)
						hi=right;
					else
						lo=left;

					ans=MIN(ans,MIN(l1,l2));
				}
			}

		printf("%.3lf\n",ans);
	}
	return 0;
}

#include <cstdio>
#include <algorithm>
using namespace std;

#define X(A,B) (A[B[0]][B[1]][B[2]][B[3]][B[4]][B[5]])

double cache[7][7][7][7][7][7];
bool vis[7][7][7][7][7][7];

double win(int h[6])
{
  if (X(vis, h)) return X(cache, h);
  X(vis, h)=true;
  X(cache, h)=0.;

  int mx=0;
  for (int i=0; i < 6; i++) mx=max(mx, h[i]);

  int i=0, hh[6];
  for (int j=0; j < mx; j++){
    for (int d=0; d < 2; d++){
      i=0 + 5 * d;
      double loss=0.;
      for (int p=1; p <= 3; p++){
        for (int k=0; k < 6; k++) hh[k]=h[k];
        int pp=p;
        int k=i;
        while (pp){
          if (k < 0 || k > 5) break;
          if (hh[k] > j) hh[k]--, pp--;
          k+=1 - 2 * d;
        }
        loss+=win(hh);
      }
      loss=(1 - loss / 3.);
      if (loss > X(cache, h)) X(cache, h)=loss;
    }
  }
  return X(cache, h);
}

int main() {
  int n;
  while (scanf("%d", &n) == 1 && n) {
    int h[6]={0};
    for (int i=0; i < n; i++) scanf("%d", &h[i]);
    printf("%.6lf\n", win(h));
  }
  return 0;
}

#include <stdio.h>
#include <algorithm>
using namespace std;
typedef long long ll;
const ll mod=987654321;

ll A[2][2],B[2][2],T[2][2];

void pow(int n)
{
	if(n==0)
	{
		for(int i=0;i<2;i++)
			for(int j=0;j<2;j++)
				B[i][j]=(i==j);
		return;
	}
	if(n&1)
	{
		pow(n-1);
		for(int i=0;i<2;i++)
			for(int j=0;j<2;j++)
			{
				T[i][j]=0;
					for(int k=0;k<2;k++)
						T[i][j]=(T[i][j]+A[i][k]*B[k][j])%mod;
			}
		for(int i=0;i<2;i++)
			for(int j=0;j<2;j++)
			{
				B[i][j]=T[i][j];
			}
		
	}
	else
	{
		pow(n/2);
		for(int i=0;i<2;i++)
			for(int j=0;j<2;j++)
			{
				T[i][j]=0;
					for(int k=0;k<2;k++)
						T[i][j]=(T[i][j]+B[i][k]*B[k][j])%mod;
			}
		for(int i=0;i<2;i++)
			for(int j=0;j<2;j++)
			{
				B[i][j]=T[i][j];
			}
		
	}
}

int main()
{
  int n;
  A[0][0]=1;	A[0][1]=1;
  A[1][0]=1;	A[1][1]=0;
  while (scanf("%d", &n) == 1 && n)
  {
	ll ans=0;
	if(n&1) ans=0;
	else if(n<4) ans=0;
	else
	{
		pow(n-4);
		ans=B[0][0]-n/2+1;
		ans%=mod;
		if(ans<0)ans+=mod;
	}
	printf("%lld\n",ans);
  }

  return 0;
}

#include<vector> 
